import React from "react";
import Card from "../card/Card-component";

const Cardlist = ({ neighbors }) => {
  {
    neighbors.map((neighbor, i) => {
      return (
        <Card id={neighbor.id} name={neighbor.name} email={neighbor.email} />
      );
    });
  }
};

export default Cardlist;
